import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useAuth } from './AuthContext';

const Dashboard = ({ navigateTo }) => {
  const { setLoggedIn } = useAuth();
  const [bookings, setBookings] = useState([]);
  const [listings, setListings] = useState([]);

  const handleLogout = () => {
    setLoggedIn(false);
    localStorage.removeItem('token'); // Clear token on logout
    navigateTo('landing');
  };

  const fetchBookings = async () => {
    // Fetch bookings from the server
    try {
      const response = await axios.get('http://localhost:5000/user-bookings', {
        headers: {
          Authorization: `Bearer ${localStorage.getItem('token')}`
        }
      });
      setBookings(response.data);
    } catch (error) {
      console.error('Error fetching bookings:', error);
    }
  };

  const fetchListings = async () => {
    // Fetch listings from the server
    try {
      const response = await axios.get('http://localhost:5000/user-listings', {
        headers: {
          Authorization: `Bearer ${localStorage.getItem('token')}`
        }
      });
      setListings(response.data);
    } catch (error) {
      console.error('Error fetching listings:', error);
    }
  };

  return (
    <div className="dashboard">
      <h2>Welcome to Your Dashboard</h2>
      <p>This is your personalized dashboard.</p>
      <button onClick={fetchBookings}>View Your Bookings</button>
      <div>
        {/* Display bookings */}
        {bookings.map(booking => (
          <div key={booking.id}>{/* Display booking details */}</div>
        ))}
      </div>
      <button onClick={fetchListings}>Manage Listings</button>
      <div>
        {/* Display listings */}
        {listings.map(listing => (
          <div key={listing.id}>{/* Display listing details */}</div>
        ))}
      </div>
      <button onClick={handleLogout}>Logout</button>
    </div>
  );
};

export default Dashboard;
